const canvas = document.getElementById("canvas1");
const ctx = canvas.getContext("2d");
const CW = canvas.width = 800;
const CH = canvas.height = 500;

// const image = document.getElementById("image1");
const image = new Image();
image.src = 'data:image/png;base64,'

window.addEventListener('load', () => {
    ctx.drawImage(image, 0, 0, 800, 500, 0, 0, 800, 500)

    const scannedImage = ctx.getImageData(0, 0, CW, CH)
    console.log(scannedImage);

    const scannedData = scannedImage.data;
    
    for(let i=0; i<scannedData.length; i+=4){
        // const redVal = scannedData[i];
        // const greenVal = scannedData[i+1];
        // const blueVal = scannedData[i+2];
        // const alphaVal = scannedData[i+3];

        const total = scannedData[i] + scannedData[i+1] + scannedData[i+2];
        const averageColorvalue = total/3;
        scannedData[i] = averageColorvalue
        scannedData[i+1] = averageColorvalue
        scannedData[i+2] = averageColorvalue
    }
     
    scannedImage.data = scannedData;
    ctx.putImageData(scannedImage,0,0)

})